function ExpenseDate(props) {
    const month = props.month.toLocaleString('en-US', { month: 'long' });
    const day = props.day;
    const year = props.year;
    return (
        <div>
            <div>{month}</div>
            <div>{day}</div>
            <div>{year}</div>
        </div>
    );
}

export default ExpenseDate;
